import React from 'react';

const LoginPage = () => {
  return (
    <>
      <h1>Volunteer Management System</h1>
      <form>
        <label>Email:</label>
        <input type="email" />
        <label>Password:</label>
        <input type="password" />
      </form>
    </>
  );
};

export default LoginPage;
